INSERT INTO `Experiment` VALUES (2,'MjhmYTFhYjNhOGM4ZjJkZDI5MzdkYzQz','428106d7-a23b-4278-84ff-bf9b883fedfc','time-to-cold-start-twelve-threads','\ntime-to-cold-start-twelve-threads: This experiment tests the time it takes for \nfunction instances to no longer be available due to inactivity in a multithreaded\nenvironment.\nThe experiment is conducted by first creating a cold time baseline. This is done by i\nnvoking a single function with 12 concurrent requests and average over the results. \nThen the same function is is invoked 10 times, again with 12 concurrent requests and \naveraged as a warm-time baseline.\nThen the function is invoked with 12 multithreaded requests continually with increasing \ndelay between invocations, until the avg of the requests falls within the cold time \nbaseline.\n','openfaas','openfaas_client_vm','3.8.2',1,932921344,0,1592320191.1531265,1592407398.29002,87207.13689351082,0),(24,'ODJlNGZlZTdhMTM2OTg0Zjk0ZDVhM2Uw','df458e93-5aa2-496a-9fc8-368aaf5f8fb6','throughput-benchmarking','\nthroughput-benchmarking: <description>\n','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592486843.2670503,1592487907.027811,1063.7607607841492,0),(29,'YzM4NTk4MjRhYmRhMGZkN2NiYmFjMGFj','c3c59c1b-4836-4c11-802e-51d262a9a904','function-lifetime','\nfunction-lifetime: Finds whether or not the is a limit for how long a FaaS function\ninstance is being kept alive. A cut-off of 24 hours is used for when a platform is\ndetermined to let functions run without ever reclaiming the resources, resulting in a\ncold start. The experiment is conducted by invoking a function at a interval 2 min.\nlower than the cold start cut of found in the single-function-time-to-cold-start \nexperiment and its instance identifier is checked to be the same every time.     \n','openfaas','openfaas_client_vm','3.8.2',1,932921344,0,1592488269.8656497,1592489839.6830676,1569.8174178600311,0),(35,'ODJlNGZlZTdhMTM2OTg0Zjk0ZDVhM2Uw','9cdd53de-df50-4039-8324-bd4bca596721','throughput-benchmarking','\nthroughput-benchmarking: <description>\n','openfaas','openfaas_client_vm','3.8.2',1,932921344,0,1592488485.4606493,1592491252.0188215,2766.558172225952,0),(36,'dev-meta','7335455e-81a8-48fc-835a-9e7297d7ae0e','dev-experiment','testing linked invocations','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494472.3245223,1592494480.2347867,7.910264492034912,0),(37,'dev-meta','4558c29d-733e-4f78-92c1-fd9fe9a2cc80','dev-experiment','run with different thread counts','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494482.3949769,1592494486.7946265,4.399649620056152,0),(38,'dev-meta','57caaccd-1421-4275-a697-71df1dc1b9ff','dev-experiment','monolith feature test','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494490.15186,1592494495.8396196,5.687759637832642,0),(39,'dev-meta','97e9261b-a454-4594-8789-59e8e1bda9af','dev-experiment','monolith feature test','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494498.6981091,1592494499.1280065,0.4298973083496094,0),(40,'dev-meta','0b823b1e-9854-49b6-a105-11d7d1368e35','dev-experiment','testing linked invocations','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494618.6482806,1592494622.9805677,4.332287073135376,0),(41,'dev-meta','eecd8f26-96ef-4e2d-beea-f6ee67520369','dev-experiment','run with different thread counts','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494625.2958508,1592494628.7480285,3.4521777629852295,0),(42,'dev-meta','2039a38c-4803-489d-83fb-d90f769a3f32','dev-experiment','monolith feature test','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494632.095754,1592494634.4090428,2.313288927078247,0),(43,'dev-meta','b80ce2ba-316a-4160-8fce-65b518ae167c','dev-experiment','monolith feature test','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494638.056174,1592494638.509954,0.453779935836792,0),(44,'dev-meta','cabfefe2-e3cd-46d5-9b90-7ca7f38f98da','dev-experiment','testing linked invocations','aws_lambda','azure_linuxvm','3.8.2',1,932921344,0,1592494658.104